DECLARE CAT_TYPE_V NUMBER;
		CAT_ID_V NUMBER;
		FORM_ID NUMBER;
		NCLOB_V NCLOB;
BEGIN
  --CAT_TYPE_V:=REP_CATEGORY_TYPE_ID_SQ.NEXTVAL;
  SELECT MAX(ID) INTO CAT_TYPE_V
    FROM REP_CATEGORY_TYPE 
   WHERE R.CAT_TYPE_V='menu';	
  NCLOB_V:=''||
		   '';			  
  UPDATE REP_DATA
	 SET DATA=NCLOB_V
   WHERE SYSNAME='gen';
   
  CAT_ID_V:=REP_CATEGORY_VALUE_ID_SQ.NEXTVAL;
  insert into REP_CATEGORY_VALUE (ID, CAT_ID, N_VALUE, S_VALUE, NUM_ORDER, PARENT_CAT_ID) values (CAT_ID_V, CAT_TYPE_V, 'Население', 'personals', 1, null);          
  FORM_ID:=REP_DATA_ID_SQ.NEXTVAL;  
  NCLOB_V:=''||
		   ''||
		   ''||
		   ''||
		   ''||
		   ''||
		   ''||
		   ''||
		   ''||
		   ''||
		   '';			  
  insert into REP_DATA (ID, NAME, SYSNAME, USER_LAST_ID, HTML, DATA)
	   values (FORM_ID, 'Загрузка оплат', 'ab_load_pays', 1, null, NCLOB_V);
  insert into REP_CATEGORY_LINKS (ID, CAT_ID, OBJ_ID) values (REP_CATEGORY_LINKS_ID_SQ.NEXTVAL, CAT_ID_V, FORM_ID);
  
  CAT_ID_V:=REP_CATEGORY_VALUE_ID_SQ.NEXTVAL;
  insert into REP_CATEGORY_VALUE (ID, CAT_ID, N_VALUE, S_VALUE, NUM_ORDER, PARENT_CAT_ID) values (CAT_ID_V, CAT_TYPE_V, 'Юридические лица', 'counterparties', 1, null);          
  FORM_ID:=REP_DATA_ID_SQ.NEXTVAL;  
  NCLOB_V:='';
  insert into REP_DATA (ID, NAME, SYSNAME, USER_LAST_ID, HTML, DATA)
	   values (FORM_ID, 'Ввод показаний', 'en_load_watermeters_val', 1, null, NCLOB_V);
  insert into REP_CATEGORY_LINKS (ID, CAT_ID, OBJ_ID) values (REP_CATEGORY_LINKS_ID_SQ.NEXTVAL, CAT_ID_V, FORM_ID);
  COMMIT;
END;    
